import React from 'react';
import { Link } from "react-router-dom"


export const Card = ({ listTodos }) => {
    return(
        <>
            {listTodos.map(todo => {
                return(
                    <Card >
                        <ul key={todo.id}>
                            <li>
                                <Card.Body> <Link to={`${todo.id}`}>{todo.content}</Link> </Card.Body> 
                            </li>
                        </ul>
                    </Card>    
                )
            })}
        </>
    )
}
